‏"سأستمر في برشلونة ولن يتغير موقفي ، بغض النظر عن مدى رغبتي في الذهاب.

‏"أخبرت النادي، الرئيس، أنني أريد الذهاب. كنت أخبره طوال العام.

‏"اعتقدت أن الوقت الذي أمضيته في برشلونة قد انتهى ، للأسف - كنت أرغب دائمًا في إنهاء مسيرتي هنا."

‏"لقد كان عاما صعبا للغاية، لقد عانيت كثيراً في التدريبات، في المباريات وفي غرفة الملابس.

‏"قال الرئيس دائمًا إنه في نهاية الموسم يمكنني أن أقرر ما إذا كنت أرغب في الذهاب أو ما إذا كنت أرغب في البقاء، وفي النهاية لم يف بوعده".

‏"أردت مشروعًا ناجحاً وأن أفوز بالألقاب مع النادي لمواصلة توسيع أسطورة برشلونة.

‏"الحقيقة هي أنه لم يكن هناك أي مشروع أو أي شيء لفترة طويلة، فهم يتلاعبون ويغطون الأخطاء مع مرور الوقت."

‏"أشعر بالأذى من الأشياء التي سمعتها من الناس، ومن الصحافة، ومن الناس الذين يشككون في برشلونة.

‏"لقد ساعدني أيضًا في معرفة أن هناك العديد من الأشخاص الزائفين جدًا.

‏"لقد آلمني عندما تم التشكيك في حبي لهذا النادي. حبي لبرشلونة لن يتغير أبدًا."

